import React from "react";
import styles from "./UserAccount.module.css"; // Import the CSS module

const UserAccount = () => {
	const token = localStorage.getItem("token");

	const runModel = async () => {
		try {
			const response = await fetch("http://localhost:5000/run-model", {
				method: "POST",
				headers: {
					"Content-Type": "application/json",
					Authorization: `Bearer ${token}`,
				},
			});
			const result = await response.json();
			alert(`Model output: ${result.output}`);
		} catch (error) {
			console.error("Error running the model:", error);
		}
	};

	return (
		<>
        <nav>
          <a href="#">
            <svg
              id="logo-15"
              width="49"
              height="48"
              viewBox="0 0 49 48"
              fill="none"
              xmlns="http://www.w3.org/2000/svg"
            >
              <path
                d="M24.5 12.75C24.5 18.9632 19.4632 24 13.25 24H2V12.75C2 6.53679 7.03679 1.5 13.25 1.5C19.4632 1.5 24.5 6.53679 24.5 12.75Z"
                className="ccustom"
                fill="#17CF97"
              ></path>
              <path
                d="M24.5 35.25C24.5 29.0368 29.5368 24 35.75 24H47V35.25C47 41.4632 41.9632 46.5 35.75 46.5C29.5368 46.5 24.5 41.4632 24.5 35.25Z"
                className="ccustom"
                fill="#17CF97"
              ></path>
              <path
                d="M2 35.25C2 41.4632 7.03679 46.5 13.25 46.5H24.5V35.25C24.5 29.0368 19.4632 24 13.25 24C7.03679 24 2 29.0368 2 35.25Z"
                className="ccustom"
                fill="#17CF97"
              ></path>
              <path
                d="M47 12.75C47 6.53679 41.9632 1.5 35.75 1.5H24.5V12.75C24.5 18.9632 29.5368 24 35.75 24C41.9632 24 47 18.9632 47 12.75Z"
                className="ccustom"
                fill="#17CF97"
              ></path>
            </svg>
          </a>
          <div>
            <ul id="navbar" className={this.state.clicked ? "active" : ""}>
              <li><a className="active" href="/home">Home</a></li>
              <li><a href="#r">Service</a></li>
              <li><a href="#">About Us</a></li>
              <li><a href="/login">Login</a></li>
            </ul>
          </div>
          <div id="mobile" onClick={this.handleClick}>
            <i id="bar" className={this.state.clicked ? 'fas fa-times' : 'fas fa-bars'}></i>
          </div>
        </nav>
		<div className={styles.userAccountContainer}>
			<h1 className={styles.title}>Welcome to Your Account</h1>
			<p className={styles.tokenDisplay}>Your token: {token}</p>
			<button className={styles.runModelButton} onClick={runModel}>
				Run Model
			</button>
		</div>
		</>
	);
};

export default UserAccount;
